import { FC } from 'react';

interface IOptionProps extends Omit<React.HTMLAttributes<HTMLDivElement>, 'id' | 'children'> {
  id: string,
  children: string,
};

const Option: FC<IOptionProps> = ({ id, children, ...other }) => {
  return (
    <div
      id={id}
      {...other}
    >
      {children}
    </div>
  )
};

export default Option;
